import productsData from "../../../data.js";
import MostPopularCard from "../../MostPopularCard/MostPopularCard.jsx";

const MostPopular = () => {
  return (
    <div style={{ color: "red" }}>
      <div className="row">
        {productsData.map((items) => {
          return (
            <div className="col-3">
              <MostPopularCard />
            </div>
          );
        }
        )}
      </div>
    </div>
  );
};

export default MostPopular;
